INSERT INTO `tp_gallery` (`id`, `title`, `type_id`, `cover_image`, `image`, `description`, `time`, `endtime`, `sort`, `contents`, `count`, `author`, `addtime`, `edittime`, `edituser`, `is_display`) VALUES
(1, '哈尔滨巴彦代理商打造标杆店铺', 2, '/Gallery/20141106/545b608b25096.jpg', '/Gallery/20141106/545b6092c0690.jpg,/Gallery/20141106/545b6092e2b20.jpg,/Gallery/20141106/545b609308fd9.jpg,/Gallery/20141106/545b60931e246.jpg', ',,,', 1415274618, 1446810618, 0, '近日，森马哈尔滨巴彦新形象店盛大开业，对周边市场起到了很好的辐射和榜样作用。\r\n该店位于巴彦县最繁华的步行街，营业面积约600平方米，采用森马最新道具和品类推广陈列方式，无论是店面形象，还是营业面积，均居当地品牌休闲服饰店铺之首。', 0, '', 1415274657, 1415275078, '森马', 1),
(2, '森马锡林浩特维多利步行街新形象店', 2, '/Gallery/20141107/545c39eda7995.jpg', '/Gallery/20141107/545c39f1c532d.jpg,/Gallery/20141107/545c39fcd8421.jpg,/Gallery/20141107/545c39ff1d639.jpg,/Gallery/20141107/545c3a01b45f0.jpg,/Gallery/20141107/545c3a04b7986.jpg,/Gallery/20141107/545c3a0693976.jpg,/Gallery/20141107/545c3a084a234.jpg', ',,,,,,', 1415330275, 1446866275, 0, '本网讯  8月23日，森马内蒙古锡林浩特维多利步行街店以森马最新形象展现在消费者面前。\r\n\r\n该店位于维多利步行街的最佳位置，为独栋建筑，上下两层，营业面积近550平方米。该店以森马最新形象装饰一新，吸引了大量消费者，销售势头火爆。\r\n\r\n沈伟\r\n', 0, '', 1415330339, 1415330339, '森马', 1),
(3, '森马合肥五河店新装亮相', 2, '/Gallery/20141107/545c3addf38ef.jpg', '/Gallery/20141107/545c3ae18acf1.jpg,/Gallery/20141107/545c3ae1c6db8.jpg,/Gallery/20141107/545c3ae1ec482.jpg', ',,', 1415330496, 1446866496, 0, '本网讯   8月8日，森马合肥五河万福商业广场旗舰店隆重开业。由“男神来袭”森马品牌形象代言人李敏镐、金秀贤广告宣传画构成的店铺外立面，端庄大气，格外引人注目，吸引了大量消费者。\r\n\r\n该店上下两层，格局划分明晰，采用最新的店铺形象和道具，从最初的设计到内部场区的划分、陈列布置，都严格按照公司标准执行，力求打造当地标杆店铺。\r\n\r\n森马合肥系统代理商专门前往该店参观学习，了解新的陈列方法，探讨县级', 0, '', 1415330533, 1415330533, '森马', 1),
(4, '森马大同华严街新形象店', 2, '/Gallery/20141107/545c3b402c44e.jpg', '/Gallery/20141107/545c3b45bb910.jpg,/Gallery/20141107/545c3b460dd95.jpg,/Gallery/20141107/545c3b464035a.jpg,/Gallery/20141107/545c3b4681e9d.jpg,/Gallery/20141107/545c3b46c0574.jpg', ',,,,', 1415330599, 1446866599, 0, '本网讯   9月28日，森马山西大同华严街新形象店开业。\r\n\r\n该店为公司多品牌集成店，面积约1100平方米，采用全新的森马十代店铺形象，和该街仿古的造型风格相得益彰，成为了商业街的标志性店铺。店铺内部还增设了游戏区和休闲饮品等功能区，为消费者提供了更加丰富的服务体验。\r\n\r\n金秋时节，森马大同代理商在公司新店政策的推动下，积极拓展市场，已开出了3店1柜，营业面积增加了近1500平方米，有力推动了', 0, '', 1415330633, 1415330680, '森马', 1);
