(5072, '森马南京代理商新春联谊齐聚一堂', 4, '', '', NULL, 1389663120, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 1月6日和8日，森马南京代理区域两场新春联谊会圆满落幕，公司森马加盟销售系统的同事与代理商齐聚一堂，总结了去年的销售。代理商们普遍认为，2013年，公司各项变革措施积极有效，增加了大家的凝聚力和归属感，未来一年，还将以饱满的心态积极为森马事业助力。</DIV>\n<DIV>6日的会上，一级代理商总结了2013年度的南京销售情况，并强调2014年度将把工作重点放到加强二级代理商的现场支援、货品指导以及员工内部培训上来，争取交上更好答卷。与会的公司同事也向代理商们介绍了公司2014年度在货品、市场政策方面的调整，代理商对于这样的利好政策表示出了极大的热情。另外，从配发、销售、增长幅度、市场拓展和日常管理等方面，南京区域还评出了9家明星店铺并对其进行了表彰。</DIV>\n<DIV>8日的员工联谊会上，则集中展示了南京区域员工的风采及合作精神，动人的歌曲、性感的热舞、搞笑的双簧、幽默的小品，让联谊会精彩纷呈；抽奖、游戏环节更是令整场晚会高潮迭起。南京区域一级代理商也对自己的功勋员工、优秀管理人员、优秀员工进行了表彰。</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201414939347.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201414939609.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201414939579.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201414939934.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201414939711.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201414939551.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 735, '阮海琴', 1389663120, 1389663120, '森马', 0, 0),
