(5080, '森马加盟辽宁区域年度总结暨迎春宴会召开', 4, '', '', NULL, 1390193460, 1420041600, 0, '<DIV align=left>本网讯&nbsp; 1月9日，森马加盟辽宁区域2013年度工作总结暨迎春宴会召开。</DIV>\n<DIV align=left>会上，森马辽宁代理商白洪勇提出了该区域未来发展的首个五年计划，并对具体工作计划做出了详尽说明。</DIV>\n<DIV align=left>一曲古筝独奏拉开了当天晚宴的序幕，旗舰店员工们精心编排的三句半小品掀起了晚会的高潮……晚会洋溢着团结、热烈的气氛。</DIV>\n<DIV align=left>与会森马代理商纷纷表示，他们将坚定地与森马一道前行，锐意进取，创新变革，争取在辽宁区域开创更美好局面。</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201420125131687.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201420125131332.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201420125131134.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201420125131434.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</DIV>', 439, '王赫', 1390193460, 1390193460, '森马', 0, 0),
