(5082, '合肥森马代理系统年度文艺晚会', 4, '', '', NULL, 1392779580, 1420041600, 0, '<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B>森马合肥区域“只因有你”文艺晚会精彩纷呈</B></DIV>\n<DIV>本网讯 &nbsp;&nbsp;1月22日，安徽江淮大戏院灯火通明，森马合肥一级、二级代理商与公司领导同事欢聚一堂，共同欣赏了合肥区域员工自编、自导、自演的文艺晚会——只因有你。晚会历时4个多小时，并对合肥区域工作十年以上的“功勋员工”进行了表彰。</DIV>\n<DIV>随着振奋人心的鼓点，铿锵有力的歌声，晚会拉开了帷幕，优美的歌曲、华丽的舞蹈、幽默的小品，每一个节目都彰显了合肥代理区域员工的智慧和多才多艺。最后一曲《相亲相爱一家人》让与会的每一个人都跟着记忆一同回顾了合肥森马14年的发展历程，也见证了合肥森马陪伴森马发展的光辉岁月。</DIV>\n<DIV>合肥代理商表示，平等、尊重、信任、合作、分享一直是合肥森马经营的最核心内容，正是因为有着这样的企业文化才有了合肥森马14年的延续和发展，今后，合肥森马还将以饱满的姿态继续跟随公司的脚步，不懈发展。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV align=right>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <B>&nbsp;&nbsp;</B><B>汪静</B></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG><IMG border=0 src="/Uploads/UploadFile/201421911357321.jpg"></STRONG></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357752.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357553.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357853.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357630.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357414.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357654.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357777.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357479.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357417.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201421911357140.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 721, '汪静', 1392779580, 1392779580, '森马', 0, 0),
