(5124, '郑州系统于3月21日召开代理商大会', 4, '', '', NULL, 1396516920, 1420041600, 0, '<DIV align=center><B>颠覆创新</B><B>&nbsp; </B><B>持续发展</B><B></B></DIV>\n<DIV align=center><B>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </B><B>——专注</B><B>·</B><B>专业</B><B>·</B><B>聚焦森马郑州加盟商表彰论坛大会</B><B></B></DIV>\n<DIV>3月21日，森马郑州系统召开了以“颠覆创新 持续发展”为主题的加盟商表彰论坛大会，与前来参会的广大二级加盟商共商2014年发展大计。</DIV>\n<DIV>会上，郑州系统各部门做了年度工作报告，并阐述了2014年的工作重心和相关政策及代理商发展方向等。随后，郑州系统和优秀加盟商们围绕当下经营形式，开展了关于如何转变经营思路，如何创新、持续发展等话题的讨论。优秀代理商们纷纷分享了各自经营的成功之处，为其他代理商提供了学习、借鉴和交流的机会。大会还表彰了12位“优秀二级加盟商”，他们将获得由郑州系统奖励的“欧洲游”。</DIV>\n<DIV>当晚，郑州系统还精心准备了答谢晚宴，郑州系统代理商江茹怡发表了讲话。她对二级市场的发展作了长远规划，并多次强调了2014年的发展方向及配套支援措施，大大加强了二级代理商14年的经营发展信心。</DIV>\n<DIV>据悉，郑州系统计划在4月中旬带领20位加盟商同赴广州市场考察学习，了解竞争品牌店铺的优秀经营模式，为客户的进一步发展添油助力。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 中一区</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201443172237242.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144317223711.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201443172237813.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201443172237888.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 462, '中一区  刘一男', 1396516920, 1396516920, '森马', 0, 0),
