(5126, '关于重点店铺14Q2第一批形象考核照片上传的通知', 19, '', '', NULL, 1396945500, 1420041600, 0, '&nbsp;&nbsp; \n<P style="LINE-HEIGHT: 150%; MARGIN: 0cm 0cm 0pt"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">各位代理商：<SPAN lang=EN-US><?xml:namespace prefix = o ns = "urn:schemas-microsoft-com:office:office" /><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 27pt; MARGIN: 0cm 0cm 0pt; mso-char-indent-count: 2.0"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">大家好！<SPAN lang=EN-US><BR>&nbsp;<SPAN style="mso-spacerun: yes">&nbsp;&nbsp;&nbsp; </SPAN></SPAN>关于<SPAN lang=EN-US>14Q2</SPAN>重点店铺的形象考核已经开始，请达标并且征订陈列品的店铺对<SPAN lang=EN-US>14Q2</SPAN>店铺形象表现情况进行拍照上传。由于<SPAN lang=EN-US>Q2</SPAN>季形象周期较长，此次形象考核结果由<SPAN lang=EN-US>Q2</SPAN>第一批形象成绩和<SPAN lang=EN-US>Q2</SPAN>第二批形象成绩合并而成。最终结果将参照《<SPAN lang=EN-US>2013</SPAN>年<SPAN lang=EN-US>Q4</SPAN>季形象支持及考核管理办法》执行。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 27pt; MARGIN: 0cm 0cm 0pt; mso-char-indent-count: 2.0"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt" lang=EN-US><BR><SPAN style="mso-spacerun: yes">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN>Q2</SPAN><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">第一批上传时间：<SPAN lang=EN-US>2014</SPAN>年<SPAN lang=EN-US>4</SPAN>月<SPAN lang=EN-US>21</SPAN>日<SPAN lang=EN-US>-2014</SPAN>年<SPAN lang=EN-US>4</SPAN>月<SPAN lang=EN-US>30</SPAN>日<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 20.25pt; MARGIN: 0cm 0cm 0pt; mso-char-indent-count: 1.5"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">上传地址：</SPAN><SPAN lang=EN-US><A href="http://pic4.semir.com/"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">http://pic4.semir.com/</SPAN></A></SPAN><SPAN style="FONT-FAMILY: ''微软雅黑