(5127, '森马南通通州店开业前3天创增幅新高', 4, '', '', NULL, 1396948440, 1420041600, 0, '<DIV align=left>本网讯&nbsp;&nbsp; 4月5<A name=_GoBack></A>日，江苏南通通州首家新形象店盛大开业，开业仅3天，增幅达13%，超越了森马江苏市场单店业绩同比增涨的最高记录。代理商汪全勇信心满满的告诉大家：“相信江苏市场会迎来再发展，再创新高的浪潮！”</DIV>\n<DIV align=left>森马通州店位于南通市通州区的核心位置，营业面积近700平方米，采用全品类的陈列推广形式，外立面大气磅礴，凸显了品牌形象。为了赶在清明小长假开业，代理商和公司同事配合默契，在半个月前就在货品运作、促销形式、宣传造势、店铺运营、氛围布置、货品推广、人员支援安排等方面达成了共识，分组分工，完成了对店铺的全方位包装。&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<B>&nbsp;</B></DIV>\n<DIV align=right><B>杨玉珏</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453715.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453416.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453274.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453629.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453462.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453358.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453262.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453441.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453199.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453193.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201448171453928.jpg"></DIV>\n<DIV