(5130, '森马宁波北仑旗舰店全新开业', 4, '', '', NULL, 1397207700, 1420041600, 0, '<DIV>本网讯 &nbsp;&nbsp;4月5日，森马宁波北仑旗舰店全新开业。</DIV>\n<DIV>该店位于宁波经济开发区繁华地段的，营业面积达1600平方米，采用森马新形象道具与独具一格的品类陈列推广方式。</DIV>\n<DIV>该店大气磅礴的店面形象和别具匠心的宣传方式吸引了广大消费者。开业当天，许多人早早赶来在店铺门前排起了长龙。</DIV>\n<DIV>森马宁波代理商孙会理对前来支持的森马加盟销售系统东一区的同事们表示感谢。他说，接踵而至的消费者就是对大家辛勤工作最好的认可。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV align=right><B>王娟&nbsp; 杨康</B></DIV>\n<DIV align=right><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117159829.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117159418.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117159220.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117159239.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117159128.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117159924.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014411715882.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117152061.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014411715876.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014411715870.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201441171510212.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20144117152087.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201441171510558.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 596, '董事长办公室二  龚', 1397207700, 1397207700, '森马', 0, 0),
(5131, '关于消费存在异常的VIP卡片管理通知', 7, '', '', NULL, 1397208960, 1420041600, 0, '<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp; 从VIP官网上线后，参与网站积分兑换礼品的消费者逐渐增加。但近期发现有个别积分存在异常的会员在VIP网站上兑换高价值礼品的情况。经查这些会员所持卡片的历史消费记录，存在超大金额消费(例如一天内消费近万元的记录)、频繁消费(例如一个月内连续数日持续消费的记录)等不属于正常消费者消费行为的现象，且礼品的收件地址为各区域的森马店铺或者类似的商铺地址。据此，公司有理由怀疑店铺存在导购人员私自开卡赚取积分、享受折扣，冒充消费者兑换积分礼品的行为。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV>这种行为严重损害了代理商、消费者以及公司的利益，带来非常不良的影响。对此公司出台以下规定：</DIV>\n<DIV>1． 森马VIP卡仅限消费者本人持有和使用，且一个客户编号只能有一张卡片，禁止门店员工违规操作。</DIV>\n<DIV>2． 对于超大金额消费、频繁消费等异常消费记录的VIP片，一经发现，公司将发函给卡片开卡门店所属的代理商或子公司协助稽核卡片真实性，代理商或子公司需在收到通知函2个工作日内，由代理商本人或子公司经理签字确认稽核结果后将通知函回传给总公司，对于逾期未反馈的则视为确认该卡为异常卡，按异常卡处理。</DIV>\n<DIV>3． 对于代理商或子公司反馈为异常的VIP卡以及逾期未反馈的异常卡，公司会对其在VIP网站兑换的礼品或者参与积分抽奖的中奖奖品做无效处理，同时将该卡片以及对应的客户编号做注销处理，卡内积分清零。</DIV>\n<DIV align=right>森马品牌中心</DIV>\n<DIV align=right>2014.4.11</DIV>', 472, '品牌传播部  王锐', 1397208960, 1397208960, '森马', 0, 0),
