(5139, '2014.4.15麻城大店开业', 4, '', '', NULL, 1397543220, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 4月1日，森马在湖北县级市场的首家大店在麻城盛大开业。</DIV>\n<DIV>该店位于麻城繁华商贸步行街，是小店变大店的典型。麻城县为湖北黄冈第一大县，市场容量巨大，而该店原有店铺形象和陈列方式已不能满足当地消费者的需求。当地代理商在公司指导和帮助下，将原有店铺营业面积扩大到800平方米。重张后的店铺面貌一新，更加吸引消费者，进店率明显上升。清明小长假期间，该店零售额同比增长21%。</DIV>\n<DIV>森马麻城代理商石明全经营森马品牌已有8年时间。他表示，面对新形势，，唯有深挖市场，做大市场份额，才能有出路；而开好大店，是实现这一目标的重要举措；在今后发展中，他们会紧跟公司步伐，把大店经营好，让森马品牌更加深入人心。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV align=right><B>周元发</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201441514277286.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201441514277268.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 719, '龚燕琼', 1397543220, 1397543220, '森马', 0, 0),
