(5153, '关于14Q2可口可乐马克杯条形码更正说明', 29, '', '', NULL, 1398748680, 1420041600, 0, '<P align=left><SPAN class=emtidy-2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <FONT size=4>14Q2可口可乐促销品马克杯-条形码更正</FONT></SPAN><BR><SPAN class=emtidy-2><FONT size=4>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</FONT></SPAN></P>\n<P align=left><SPAN class=emtidy-2><FONT size=4>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <SPAN class=emtidy-3>各位代理商，可口可乐促销品马克杯条形码，因为供应商印刷错误，导致零售时候无法扫描录入；现把更正后的条码以图片及附件的形式上传到商务网。附件为WORD版本（含马克杯图片及正确条码），请代理商直接下载并打印放置收银台，在结算时扫描，谢谢配合！</SPAN><BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=emtidy-4>基础男装产品部&nbsp;&nbsp;</SPAN></FONT></SPAN></P>\n<P align=center><SPAN class=emtidy-2><FONT size=4><SPAN class=emtidy-4><IMG border=0 src="/Uploads/UploadFile/201443011333975.gif"><A href="/Uploads/UploadFile/20144301123139.zip" target=_blank>可乐杯子条形码.zip</A></SPAN></FONT></SPAN></P><SPAN class=emtidy-2><FONT size=4><SPAN class=emtidy-4></SPAN>\n<P align=left><BR><IMG style="WIDTH: 694px; HEIGHT: 449px" border=0 src="/Uploads/UploadFile/201443011333732.jpg" width=796 height=563></P>\n<P align=left><A href="/Uploads/UploadFile/201443011134841.zip" target=_blank></A></FONT>&nbsp;</P></SPAN>', 774, '基础男装产品部  桑', 1398748680, 1398827580, '森马', 0, 0),
(5154, '5.1期间森马69家新店精彩绽放', 4, '', '', NULL, 1398764880, 1420041600, 0, '<P align=center><IMG border=0 src="/Uploads/UploadFile/2014429175848681.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014429175848550.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014429175848240.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014429175848483.jpg"></P>', 593, '市场部', 1398764880, 1398765480, '森马', 0, 0),
(5155, '森马信息中心更换技术支持QQ的通知', 29, '', '', NULL, 1398824700, 1420041600, 0, '<DIV>尊敬的代理商：</DIV>\n<DIV>信息中心为加强对终端门店的技术支持质量与的服务管理。原811开头的技术支持QQ即日起停用，启用唯一技术支持QQ号码为：800086115。接入方法如下：</DIV>\n<DIV>在个人QQ中选择查找后，在找服务中输入QQ号码：“800086115”或“森马”或“semir”，点击查找，如下图<A name=_GoBack></A> </DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014430102511755.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014430102511341.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV>找到森马服饰信息中心，点击咨询，即可与工程师进行交流。</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201443010251199.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV>在弹出的窗口中，点击所需要联系的工程师，把问题描述清楚，即可请求工程师进行故障协助处理。</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014430102511554.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV>故障处理结束后，请对工程师的服务质量进行评价，您的评价将是对我们的工作最大的鼓励。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 森马信息中心</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年4月28日星期一</DIV>', 354, '客户服务科  章健', 1398824700, 1398824700, '森马', 0, 0),
