(5161, '森马哈尔滨巴彦代理商打造标杆店铺', 22, '', '', NULL, 1399277340, 1420041600, 0, '<DIV>近日，森马哈尔滨巴彦新形象店盛大开业，对周边市场起到了很好的辐射和榜样作用。</DIV>\n<DIV>该店位于巴彦县最繁华的步行街，营业面积约600平方米，采用森马最新道具和品类推广陈列方式，无论是店面形象，还是营业面积，均居当地品牌休闲服饰店铺之首。</DIV>\n<DIV>为配合新店开业，代理商精心策划了派送礼品、抽奖、微信互动以及演出表演等宣传推广方式，取得了良好效果。</DIV>\n<DIV>巴彦二级代理商表示，将努力把该店打造成哈尔滨二级市场的标杆店铺，抢占市场份额，让森马品牌更深入人心。</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145516948368.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145516948294.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145516948151.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145516948566.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 1372, '黑龙江区  施静文', 1399277340, 1399277340, '森马', 0, 0),
(5162, '森马满洲里兴华街店老店新开再出发', 4, '', '', NULL, 1399343520, 1420041600, 0, '<DIV align=left>本网讯&nbsp;&nbsp;&nbsp; 5月1日，森马大庆满洲里兴华街老店迎来了自己的第二次开业。</DIV>\n<DIV align=left>该店位于满洲里市核心地段，在原有的基础上，代理商对该店进行了翻倍扩店，不仅使营业面积增至800平方米，而且通过重新装修使店铺面貌焕然一新。该店采用全新重点区域品类推广的陈列方式，吸引了不少消费者，进店率明显提升。“五一”小长假期间，该店零售额同比增长了67.8%。</DIV>\n<DIV align=left>森马大庆代理商王凯表示，面对新形势、新竞争，唯有做大市场份额，开好大店，才能有出路。</DIV>\n<DIV align=right><B>刘德明</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103225126.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103225220.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145610321422.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103225658.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103225715.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103226910.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103226755.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103226202.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103226858.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145610321801.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103227310.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456103227693.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 442, '董事长办公室二  龚', 1399343520, 1399343520, '森马', 0, 0),
(5163, '江苏海门解放路二店盛大开业', 4, '', '', NULL, 1399344300, 1420041600, 0, '<DIV align=left>本网讯&nbsp; 4月30日，森马江苏海门解放路二店盛大开业。</DIV>\n<DIV align=left>森马海门店位于海门市核心位置，营业面积近400平方米，采用全品类的陈列推广形式，外立面大气磅礴，营造出简约大气、低调奢华的森马新形象。卖场陈列注重品类间的搭配性，单品深度明显，有效保障了畅销单品的货量。开业当天，主推单品出现卖断现象，达到了“推什么卖什么”的效果。</DIV>\n<DIV align=left>海门店开业前4天实现了销售收入同比11%的增长。海门代理商认为，该店具有样本作用，将拉开江苏区域大发展、大增长的序幕。</DIV>\n<DIV align=right><B>杨江婷</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555558.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555203.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555905.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555305.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555306.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555990.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555330.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555226.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555828.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555766.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555545.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201456104555477.jpg"></DIV>\n<DIV align=center><STRONG></ST