(5164, '线路优化和升级通知', 29, '', '', NULL, 1399369800, 1420041600, 0, '<DIV align=left><A name=_GoBack>本周二（2014年5月6日星期二）晚上10：00至12：00将对VPN线路进行优化和升级。</A></DIV>\n<DIV align=left>本次优化和升级主要优化VPN线路南北电信、网通、移动用户访问速度。</DIV>\n<DIV align=left>调试升级期间，VPN用户连接可能会出现闪断现象，届时重新登录即可恢复正常访问。</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=left>上海现场值班人员： 陈项汶 13761972958</DIV>\n<DIV align=left>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;肖伟&nbsp;&nbsp; 18616809271</DIV>\n<DIV align=left>应急联系电话：&nbsp;&nbsp;&nbsp; 郑玉宇&nbsp; 18802136986</DIV>\n<DIV align=left>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 信息中心</DIV>', 466, '网络管理科   陈项', 1399369800, 1399369800, '森马', 0, 0),
