(5167, '森马运城解放中路二店扩店开业', 4, '', '', NULL, 1399431000, 1420041600, 0, '<DIV>本网讯&nbsp; 森马运城解放中路二店日前重张开业。</DIV>\n<DIV>森马运城解放中路二店是森马终端小店变大店的典型。经过重新装修，该店营业面积扩大到500平方米，面貌焕然一新，无论是壮观的店铺外立面，还是新的形象道具，都十分吸引人，顾客进店率明显提升。清明节当天，零售额同比增长了165%。</DIV>\n<DIV>森马运城代理商乔燕云表示，开好大店是深挖市场、做大市场份额的重要举措，今后，还要紧跟公司步伐，把大店的经营管理抓上去，让森马品牌在当地更有竞争力。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <B>&nbsp;</B><B>王步霖</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027399.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027156.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027914.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027199.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027932.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027828.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027169.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201457105027179.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 605, '董事长办公室二  龚', 1399431000, 1399431000, '森马', 0, 0),
(5168, '森马甘肃首家千平大店盛大开业', 4, '', '', NULL, 1399511820, 1420041600, 0, '<DIV>本网讯 <B>&nbsp;&nbsp;</B>5月1日，森马甘肃首家蘑菇云千平大店在天水麦积步行街盛大开业。</DIV>\n<DIV>该店营业面积超过1000平方米，采用最新9代新形象，高端大气的硬件装修和以品类推广为核心的陈列包装，让该店成为麦积区一道亮丽的风景线。</DIV>\n<DIV>该店开业以来，生意火爆，销售远超其他同类品牌。森马麦积代理商表示，十分认可公司的大店发展战略，将继续扩大森马品牌在当地的领先势头。</DIV>\n<DIV align=right><B>车兰芳</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891747229.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891747210.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891747968.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891747424.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891748334.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891748230.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891748470.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891748706.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891748408.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20145891748458.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 645, '董事长办公室二  龚', 1399511820, 1399511820, '森马', 0, 0),
