(5170, '森马江苏区域组织开展区域集训', 4, '', '', NULL, 1399625040, 1420041600, 0, '<DIV align=left>本网讯&nbsp; 森马加盟销售系统东大区日前启动了江苏区域集训项目，分别在南京、苏州、通州等地组织了三场培训。</DIV>\n<DIV align=left>本次区域培训的重点内容是14Q2品类推广的指引及现场实操指导。通过本次培训，学员们<A name=_GoBack></A>对夏装品类推广的现场实操能力有了较大提升，实现了终端形象的统一。</DIV>\n<DIV align=left>另外，江苏区域还针对店长个人能力提升开展了一系列的培训项目，为提升终端店铺零售打下了坚实基础。</DIV>\n<P align=center>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <B>王文亮</B></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459164440383.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459164440365.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459164440167.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459164440859.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459164440692.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459164440364.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459164440660.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG borde