(5171, '“如何卖配件”代理商采访实录02', 12, '', '', NULL, 1399625940, 1420041600, 0, '<DIV>&nbsp; 大家好：<BR>&nbsp;&nbsp;&nbsp;本次视频为森马优秀零售一线管理者-陕西咸阳旗舰店的精彩零售经验分享，很多都是大家比较关注的话题，例如：怎么做陈列？如何做促销？怎么做推广等精彩的内容，现将采访视频分享给大家，希望能帮助大家在2014年取得更佳的业绩。<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 视频地址：<A href="http://v.youku.com/v_show/id_XNzA5Njc0MzUy.html">http://v.youku.com/v_show/id_XNzA5Njc0MzUy.html</A></DIV>\n<DIV>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;搜索地址：优酷，名称：森马店铺采访（配件）&nbsp;&nbsp;&nbsp; <BR>采访信息：<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.视频中“陕西咸阳店”位于陕西咸阳团结路步行街的旗舰店，占地面积约1200平方，配件零售量占比13%，配件零售占比5%。<BR>&nbsp;&nbsp;&nbsp; &nbsp;2.视频中采访人物为咸阳零售一线管理者范女士 ，是一位拥有多年零售和管理经验的零售一线管理者。</DIV>3.采访时间：2014-4-26<BR><BR>', 421, '配件商品部  曹菊秀', 1399625940, 1399625940, '森马', 0, 0),
(5172, '配件标杆店-陕西咸阳', 12, '', '', NULL, 1399627380, 1420041600, 0, '<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343526.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343619.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343421.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343440.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343217.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343169.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343129.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343420.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343122.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343680.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201459172343459.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center>&nbsp;</P>', 613, '配件商品部  曹菊秀', 1399627380, 1399627380, '森马', 0, 0),
