(5174, '一封来自二级客户的感谢信', 4, '', '', NULL, 1399874880, 1420041600, 0, '<DIV>近日，森马报编辑部收到一封来自巴拉巴拉阳泉代理商王丽的感谢信，她希望在信中对巴拉巴拉山西一级代理商在她家庭变故时给予的无私帮助和慷慨解囊道一声“感谢”。</DIV>\n<DIV>&nbsp;&nbsp;&nbsp; 2013年，王丽经过市场考察和深思熟虑，加盟到了品质与知名度俱佳的巴拉巴拉品牌，并将近200万的家产投入到了商业拓展中。经过两个多月山西一级代理的指导和自身的不懈努力，王丽在阳泉的两个店铺逐步步入正轨，业绩小有起色。</DIV>\n<DIV>然而，因为事业忙碌，王丽没有留意到孩子经常感到疲乏。一周前，王丽的孩子开始高热不退，并出现了下肢紫癜，当她带孩子到当地医院就诊时，等来的却是晴天霹雳。她被医院告知，孩子可能患有白血病。不肯相信的王丽又带着店铺的一点周转资金辗转到中国权威——天津医学科学院血液病研究所就诊，被确诊为急性淋巴细胞白血病，治疗费用约七八十万。</DIV>\n<DIV>看着孩子苍白的面容和对求生的渴望，王丽的心都碎了，因为把家里所有的钱都投入到了店里，她无力负担高额的医疗费用。因为孩子的病情，疏于管理的阳泉公司生意开始下滑。当她满怀愧疚向山西代理商马麟总经理汇报情况时，马麟却在电话那头像大姐一样安慰她：别担心，我会和你一起承担，共度难关。孩子的病一定能好起来的！”<BR>&nbsp;&nbsp;&nbsp; 马麟立刻派人到店铺亲自安排冬款退货事宜；时临阳泉市场夏装特卖，马麟垫资按需要全部发货；又千里迢迢和平定代理商孟志军到天津血液研究所探望孩子。马麟拉着王丽的手，安慰并让她放下全部牵挂投入到对孩子的照顾，生意上的事情有她做坚实后盾。临走时，马麟塞了一万元放到王丽的手里，孟志军也给留了两千元。这让正陷于极度苦难的王丽感到无比的温暖与力量，也让她坚信可以度过此次难关。</DIV>\n<DIV>长期以来，森马的共赢文化成就了森马的快速发展，让每一个森马人都像家人一样紧紧团结在一起。这种文化不仅影响着森马的内部，也影响了森马上下游的所有合作伙伴。今年以来，公司积极倡导一级代理商加强对二级代理商的服务力度，并将森马文化通过培训和宣导进行潜移默化的传承。</DIV>\n<DIV>据悉，公司总部知悉王丽的事后，也正在积极筹备援助资金。</DIV>\n<DIV align=right><B>王玮静</B></DIV>', 914, '董事长办公室二  龚', 1399874880, 1399874880, '森马', 0, 0),
