(5180, '关于重点店铺14Q2第二批形象考核照片上传的通知', 19, '', '', NULL, 1400810520, 1420041600, 0, '&nbsp; \n<P style="LINE-HEIGHT: 150%"><B style="mso-bidi-font-weight: normal"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">各位代理商：<SPAN lang=EN-US><?xml:namespace prefix = o ns = "urn:schemas-microsoft-com:office:office" /><o:p></o:p></SPAN></SPAN></B></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 27pt; mso-char-indent-count: 2.0"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">大家好！<SPAN lang=EN-US><BR>&nbsp;<SPAN style="mso-spacerun: yes">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN></SPAN>关于<SPAN lang=EN-US>14Q2</SPAN>重点店铺的形象考核已经开始，请达标并有征订陈列品的店铺对<SPAN lang=EN-US>14Q2</SPAN>店铺形象表现情况进行拍照上传。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 27pt; mso-char-indent-count: 2.0"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">第二批形象考核主题：什么<SPAN lang=EN-US>T </SPAN><B style="mso-bidi-font-weight: normal">· </B>热力狂欢 。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; MARGIN-LEFT: 27pt"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">考核内容：<SPAN lang=EN-US> 1、</SPAN>世界杯<SPAN lang=EN-US>\\</SPAN>可口可乐橱窗表现、形象区表现、边场表现。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt" lang=EN-US><SPAN style="mso-spacerun: yes">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</SPAN>2 、</SPAN><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">情侣<SPAN lang=EN-US>TEE</SPAN>橱窗表现、店内表现。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt" lang=EN-US><SPAN style="mso-spacerun: yes">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</SPAN>3、 </SPAN><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">男女装旅行<SPAN lang=EN-US>TEE</SPAN>店内表现。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 20.25pt; mso-char-indent-count: 1.5"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt" lang=EN-US><SPAN style="mso-spacerun: yes">&nbsp;&nbsp;&nbsp;&nbsp; </SPAN>Q2</SPAN><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">第二批上传时间：<SPAN lang=EN-US>2014</SPAN>年<SPAN lang=EN-US>6</SPAN>月<SPAN lang=EN-US>9</SPAN>日<SPAN lang=EN-US>-2014</SPAN>年<SPAN lang=EN-US>6</SPAN>月<SPAN lang=EN-US>20</SPAN>日。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 20.25pt; mso-char-indent-count: 1.5"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">&nbsp;&nbsp;&nbsp; 上传地址：</SPAN><SPAN lang=EN-US><A href="http://pic4.semir.com/"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">http://pic4.semir.com/</SPAN></A></SPAN><SPAN style="FONT-FAMILY: ''微软雅黑'',''sans-serif''" lang=EN-US><o:p></o:p></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 20.25pt; mso-char-indent-count: 1.5"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">&nbsp;&nbsp;&nbsp; 上传文件夹：店铺名称—<SPAN lang=EN-US>14Q2</SPAN>陈列考核。</SPAN><SPAN style="FONT-FAMILY: ''微软雅黑'',''sans-serif''" lang=EN-US><o:p></o:p></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 20.25pt; mso-char-indent-count: 1.5"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: ''微软雅黑'',''sans-serif''; FONT-SIZE: 13.5pt">&nbsp;&nbsp;&nbsp; 照片上传格式：<SPAN lang=EN-US>jpg/jpeg</SPAN>格式。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEI