(5185, '2014年森马湖南招商推介会', 29, '', '', NULL, 1401339240, 1420041600, 0, '<DIV align=left>携手森马，共创辉煌，聚力打造合伙人！</DIV>\n<DIV align=left>为了推进公司渠道业务发展，推进空白市场的开发，提升森马品牌在湖南市场的占有率，向广大客户传达休闲市场前景及行业机会的信息，2014年森马湖南招商推介会将于2014年7月5日在长沙市举行。请有合作意愿者尽快联系我们，热诚欢迎各位代理商朋友积极推荐意向客户！</DIV>\n<DIV align=left>&nbsp;</DIV>\n<DIV align=left>合伙人热线：</DIV>\n<DIV>陈先生（湘北）：15921607319</DIV>\n<DIV>&nbsp; 靳先生（湘西）：18621679975</DIV>\n<DIV>周先生（湘南）：13817004331</DIV>\n<DIV>薛先生（湘中）：13968894398</DIV>\n<DIV>&nbsp;</DIV>\n<DIV align=right>区&nbsp;&nbsp; 域：中二区</DIV>\n<DIV align=right>2014年5月29日</DIV>', 922, '中二区  刘仁汉', 1401339240, 1401339240, '森马', 0, 0),
