(5188, '2014.6.9东二区4、5月份PK赛', 4, '', '', NULL, 1402307460, 1420041600, 0, '<DIV align=center><B>森马加盟销售系统东二区4、5月份可比老店PK赛完美收官</B></DIV>\n<DIV>本网讯&nbsp;&nbsp; 近日，森马加盟销售系统东二区4、5月份可比老店PK赛完美收官，安徽阜南市场荣获团体第一名，阜南、威海、栖霞市场分获区域前三甲。</DIV>\n<DIV>为响应森马加盟销售系统组织的各大区可比老店PK赛，进一步提升终端零售业绩，东二区在讨论确定方案后，制定了主题为“华山论剑”的PK赛，PK赛共4周，按4阶段分别进行。销售经理们两两分为一组，带领“东邪”“西毒”“南帝”“北丐”四个客户小组进行PK，主要考核可比老店的同比提升和指标达成以及加权平均，按照排名结果分别对代理商和销售经理组进行奖惩。</DIV>\n<DIV>PK期间，销售经理与代理商齐心协力，在货品准备、陈列调整以及人员激励等环节做足了准备，向代理商传达了最新的公司货品特点、陈列方针以及变革的要点，加深了与代理商的沟通合作，服务了代理商的发展。</DIV>\n<DIV align=right><B>徐娟</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201469175115327.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201469175115816.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201469175115618.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>', 381, '董事长办公室二', 1402307460, 1402307460, '森马', 0, 0),
