(5190, '男神预热橱窗推广方案', 18, '', '', NULL, 1402363560, 1420041600, 0, '<P align=center><IMG border=0 src="/Uploads/UploadFile/2014620237958.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014620237828.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014620237798.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014620237365.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014620237142.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center>&nbsp;</P>', 1656, '视觉创意科', 1402363560, 1402363560, '森马', 0, 0),
(5191, '门店翻新：老树开新花', 4, '', '', NULL, 1402365060, 1420041600, 0, '<DIV>国际奢侈品牌Loewe,对全球门店进行翻新,巴黎店重新开业…….</DIV>\n<DIV>国际奢侈品牌Dior米兰店翻新重新开业……..</DIV>\n<DIV>上海百盛淮海店翻新重新开业……..</DIV>\n<DIV>众所周知，时尚靓丽的门店形象给消费者提供良好的品牌感知和消费环境。好的门店形象周期维持在24-36月，即3年重新装修成为门店不成文的规则。然而重新装的成本，让众多品牌望而却步，只得让老旧形象勉强上阵，导致形象破损，销售下滑的恶性循环。如何相打破僵局？门店翻新成为各行业各品牌的新策略。</DIV>\n<DIV>2013年森马推出“门店翻新”政策，鼓励代理商，花小钱，办大事，老树开新花。</DIV>\n<DIV>据市场部统计，目前翻新门店已有6家，翻新面积约31422㎡，翻新门店销售提升10%—30%，真正实现了节省成本提升销售的双赢。</DIV>\n<DIV>2014年公司继续沿袭“门店翻新”政策，公司赠送门头发光字体，对内部翻新的道具、墙面、地砖、收银台、试衣间、灯光、橱窗等进行补贴。</DIV>\n<DIV>鼓励2年以上面积200㎡以上店铺，特别是地级市，主商圈的门店。公司将优先对这些门店进行翻新设计，配合男神代言的东风，使之成为当地独树一帜的新形象，新风格。</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20146205155904.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20146205155210.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 776, '渠道管理', 1402365060, 1402365060, '森马', 0, 0),
