(5195, '关于1421940525款召回通知', 29, '', '', NULL, 1402628520, 1420041600, 0, '<DIV></DIV>\n<P style="TEXT-ALIGN: center" class=MsoNormal align=left><SPAN style="FONT-FAMILY: 华文宋体; FONT-SIZE: 18pt"><FONT face=黑体>关于1421940525<FONT size=5><SPAN lang=EN-US><FONT size=3></FONT></SPAN>款召回通知</FONT></FONT> <SPAN lang=EN-US><?xml:namespace prefix = o ns = "urn:schemas-microsoft-com:office:office" /><o:p></o:p></SPAN></SPAN></P>\n<P class=MsoNormal align=left><SPAN lang=EN-US><o:p></o:p></SPAN></P>\n<P class=MsoNormal align=left><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">尊敬的代理商：<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="TEXT-INDENT: 28pt; mso-char-indent-count: 2.0" class=MsoNormal align=left><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast" lang=EN-US>14</SPAN><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">年夏季提升线产品<SPAN lang=EN-US><FONT size=3>1421940525</FONT></SPAN>款因在零售过程中，出现严重洗后移色现象，经决定，对此款做召回处理。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="TEXT-INDENT: 27.55pt; mso-char-indent-count: 1.96" class=MsoNormal align=left><B style="mso-bidi-font-weight: normal"><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">请代理商发托运（到付），运费由公司承担。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></B></P>\n<P style="TEXT-INDENT: 28pt; MARGIN-RIGHT: 0px; mso-char-indent-count: 2.0" dir=ltr class=MsoNormal align=left><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">各位代理商在收到通知后按照前期发放的《次品退货通知》、《关于代理商退货操作要求》，全部退回<B>温州次品待处理仓。</B>为了避免给您带来不必要的损失，请务必按照退货要求执行。召回时间为<SPAN lang=EN-US>6</SPAN>月<SPAN lang=EN-US>16</SPAN>日<SPAN lang=EN-US>-7</SPAN>月<SPAN lang=EN-US>16</SPAN>日，所有货品请在<SPAN style="COLOR: red" lang=EN-US>2014</SPAN><SPAN style="COLOR: red">年<SPAN lang=EN-US>7</SPAN>月<SPAN lang=EN-US>16</SPAN>日</SPAN>前退回至公司，请对召回款单独包装并在外包装注明“<FONT face=宋体><SPAN lang=EN-US><FONT size=4>1421940525</FONT></SPAN>款召回”字样。<SPAN lang=EN-US><o:p></o:p></SPAN></FONT></SPAN></P>\n<P style="TEXT-ALIGN: left; MARGIN-LEFT: 10pt; mso-layout-grid-align: none" class=MsoNormal align=left><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast" lang=EN-US><SPAN style="mso-spacerun: yes">&nbsp; </SPAN></SPAN><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">仓库设置：<SPAN lang=EN-US>WZ09-</SPAN>次品待处理仓；道讯系统中选择退货类型为“次品”；温州仓次品收货地址：<B style="mso-bidi-font-weight: normal">温州市瓯海区娄桥工业园森茂路<SPAN lang=EN-US>1</SPAN>号，森马物流部收，电话：<SPAN lang=EN-US>0577-85789905</SPAN>，<SPAN lang=EN-US>85789906</SPAN></B>。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P class=MsoNormal align=left><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast" lang=EN-US><SPAN style="mso-spacerun: yes">&nbsp;&nbsp; </SPAN><SPAN style="mso-spacerun: yes">&nbsp;</SPAN></SPAN><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">由此给您带来的不便敬请谅解。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="TEXT-INDENT: 28pt; mso-char-indent-count: 2.0" class=MsoNormal align=left><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">谢谢您的支持与配合。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P class=MsoNormal align=left><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast" lang=EN-US><o:p>&nbsp;</o:p></SPAN></P>\n<P style="TEXT-INDENT: 217pt; MARGIN-RIGHT: 28pt; mso-char-indent-count: 15.5" class=MsoNormal align=center><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">浙江森马服饰股份有限公司<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>\n<P style="TEXT-ALIGN: center; MARGIN: 0cm 28pt 0pt 21pt" class=MsoNormal align=right><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast" lang=EN-US><SPAN style="mso-spacerun: yes">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</SPAN>2014</SPAN><SPAN style="FONT-FAMILY: 宋体; FONT-SIZE: 14pt; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-fareast">年6月13日<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P>', 655, '商品运营部', 1402628520, 1406264460, '森马', 0, 0),
