(5199, '森马江苏区域推出精英店长成长计划', 4, '', '', NULL, 1402975380, 1420041600, 0, '<DIV align=left>本网讯&nbsp;&nbsp; 为提升终端店铺店长的综合实力，促进终端店铺零售业绩的提升，森马江苏区域推出为期一年的精英店长成长计划。</DIV>\n<DIV align=left>将PK机制常态化，对终端店铺进行月月PK，是本次计划的一大特点，不仅PK店铺的零售业绩指标达成，还PK店铺的陈列形象。经过3个月的实施与跟进，终端店铺零售和陈列有了很大的进步。3月份，江苏整体零售表现提升了12%，9个PK店铺中有5个店的零售提升都超过了30%；4月份，有4家PK店铺零售提升在10%以上；5月份参与的PK店铺扩大至15家，其中的13家零售提升幅度较大，使得整体零售提升了28%。</DIV>\n<DIV align=left>代理商纷纷表示，精英店长计划非常有意义，使店铺的店员们比以前更有激情，店铺的形象也比以前更好了，业绩同比去年也都有了大幅度的提升。<A name=_GoBack></A>另外，为了让终端店长个人们能在PK中有进步、有成长，精英店长计划还组建了店长微信群，时时上传业绩，交流经验，并通过微信进行店铺陈列考核，跟进店长工作，做到了区域内交流的公开透明，也推动了店铺间的竞争。</DIV>\n<DIV align=right>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <B>王文亮</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461715446519.jpg"></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461715446389.jpg"></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461715446191.jpg"></DIV>', 533, '董事长办公室二', 1402975380, 1402988640, '森马', 0, 0),
(5200, '榆林森马代理商组织员工户外拓展训练', 4, '', '', NULL, 1402975620, 1420041600, 0, '&nbsp; \n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 24pt; mso-char-indent-count: 2.0" class=MsoNoSpacing><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: 黑体; FONT-SIZE: 12pt; mso-hansi-font-family: 宋体; mso-hansi-theme-font: minor-fareast">本网讯</SPAN><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; FONT-SIZE: 12pt; mso-hansi-theme-font: minor-fareast; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast" lang=EN-US><SPAN style="mso-spacerun: yes">&nbsp; </SPAN>6</SPAN><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; FONT-SIZE: 12pt; mso-hansi-theme-font: minor-fareast; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast">月<SPAN lang=EN-US>11</SPAN>日、<SPAN lang=EN-US>12</SPAN>日，森马榆林代理商分两批次组织员工户外拓展训练，以培养</SPAN><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; COLOR: #333333; FONT-SIZE: 12pt; mso-hansi-theme-font: minor-fareast; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Arial">协同能力，重塑团队活力，推动组织成长。<SPAN lang=EN-US><?xml:namespace prefix = o ns = "urn:schemas-microsoft-com:office:office" /><o:p></o:p></SPAN></SPAN></P>\n<P style="LINE-HEIGHT: 150%; TEXT-INDENT: 24pt; mso-char-indent-count: 2.0" class=MsoNoSpacing><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; COLOR: #333333; FONT-SIZE: 12pt; mso-hansi-theme-font: minor-fareast; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast; mso-bidi-font-family: Arial">为期两天的户外拓展训练，寓教于乐，既让参训员工放松身心，又收获满满。“拼图组队”、“齐眉棍”等项目提升了快速适应能力，“信任背摔”项目增进了彼此间的信任，“无敌风火轮”、“背靠背运球”项目让大家明白了协同合作的重要性，“人桥接龙”项目则强调了吃苦耐劳的精神……此外，还有拔河比赛、集体烧烤、卡拉<SPAN lang=EN-US>OK</SPAN>和水上项目等，使此次拓展训练的内容丰富多彩。<SPAN lang=EN-US><o:p></o:p></SPAN></SPAN></P><?xml:namespace prefix = v ns = "urn:schemas-microsoft-com:vml" /><v:shapetype id=_x0000_t75 stroked="f" filled="f" path="m@4@5l@4@11@9@11@9@5xe" o:preferrelative="t" o:spt="75" coordsize="21600,21600"><v:stroke joinstyle="miter"></v:stroke><v:formulas><v:f eqn="if lineDrawn pixelLineWidth 0"></v:f><v:f eqn="sum @0 1 0"></v:f><v:f eqn="sum 0 0 @1"></v:f><v:f eqn="prod @2 1 2"></v:f><v:f eqn="prod @3 21600 pixelWidth"></v:f><v:f eqn="prod @3 21600 pixelHeight"></v:f><v:f eqn="sum @0 0 1"></v:f><v:f eqn="prod @6 1 2"></v:f><v:f eqn="prod @7 21600 pixelWidth"></v:f><v:f eqn="sum @8 21600 0"></v:f><v:f eqn="prod @7 21600 pixelHeight"></v:f><v:f eqn="sum @10 21600 0"></v:f></v:formulas><v:path o:connecttype="rect" gradientshapeok="t" o:extrusionok="f"></v:path><o:lock aspectratio="t" v:ext="edit"></o:lock></v:shapetype>\n<P style="TEXT-ALIGN: right; LINE-HEIGHT: 150%; MARGIN-RIGHT: 10pt" class=MsoNoSpacing align=right><v:shape style="Z-INDEX: 1; POSITION: absolute; TEXT-ALIGN: left; MARGIN-TOP: 42.75pt; WIDTH: 486.75pt; HEIGHT: 307.5pt; VISIBILITY: visible; MARGIN-LEFT: -27pt; LEFT: 0px; mso-wrap-style: square; mso-wrap-distance-left: 9pt; mso-wrap-distance-top: 0; mso-wrap-distance-right: 9pt; mso-wrap-distance-bottom: 0; mso-position-horizontal: absolute; mso-position-horizontal-relative: text; mso-position-vertical: absolute; mso-position-vertical-relative: text" id=图片_x0020_1 alt="竞技.png" type="#_x0000_t75" o:spid="_x0000_s1026"><v:imagedata o:title="竞技" src="file:///C:\\DOCUME~1\\JIANGP~1\\LOCALS~1\\Temp\\msohtmlclip1\\01\\clip_image001.png"></v:imagedata><?xml:namespace prefix = w ns = "urn:schemas-microsoft-com:office:word" /><w:wrap type="square"></w:wrap></v:shape><B style="mso-bidi-font-weight: normal"><SPAN style="LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; FONT-SIZE: 12pt; mso-hansi-theme-font: minor-fareast; mso-ascii-theme-font: minor-fareast; mso-fareast-font-family: 宋体; mso-fareast-theme-font: minor-fareast">陈荣宇</SPAN></B></P>\n<P style="TEXT-ALIGN: right; LINE-HEIGHT: 150%; MARGIN-RIGHT: 10pt" class=MsoNoSpacing align=center><B style="mso-bidi-font-weight: normal"><SPAN style="LINE-HEIGH