(5202, '2014.6.11合肥代理系统户外拓展', 4, '', '', NULL, 1403054820, 1420041600, 0, '<DIV align=left>本网讯 &nbsp;&nbsp;近日，在风景优美的六安万佛湖，森马合肥代理区域组织了一场大型的户外拓展活动。合肥区域共200多名员工在拓展中收获了自信，更懂得了团队中合作的重要性。</DIV>\n<DIV align=left>参加户外拓展的200多名员工被分成了9个“部落”——青龙、白虎、朱雀、玄武、腾蛇、饕餮、麒麟、貔貅、鲲鹏。每个部落都选出了自己的“酋长”和“巫师”，还有各自的口号、队歌和舞蹈等，为拓展活动增添了许多趣味。</DIV>\n<DIV align=left>拓展中的“赤脚踩玻璃”项目给大家留下了深刻印象。刚开始大家都觉得怵得慌，甚至害怕被划伤，直到自己亲身体验安然无恙通过后，才发现看似困难的项目其实没有那么可怕，只要战胜心理障碍，勇敢迈出去尝试就可以成功。参与后的同事都表示，很受启发，今后无论是工作还是生活都要努力拼搏绝不轻言退缩。</DIV>\n<DIV align=left>还有“群龙取水”，看哪队在规定时间内取得的水最多为胜。看似不可能取到水的距离，在大家团结默契地配合下，通过合理的分工，和远近水源的分配，最终完成了整个游戏，让大家体会了团队协作、整合资源的意义。另外，还有考验大家团队沟通能力的超音速团队和各项有启发性的小游戏都促进了团队之间的相互信任和交流。</DIV>\n<DIV align=left>拓展活动把原来松散的个体们组合在了一起，大家一齐努力克服困难的过程，提振了信心，锻炼了胆识，也为合肥团队今后的发展磨练了意志。</DIV>\n<DIV align=right>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <B>&nbsp;</B><B>马利</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461892721185.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461892721955.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461892721925.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461892721324.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461892721326.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20146189272110.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 700, '董事长办公室二', 1403054820, 1403054820, '森马', 0, 0),
