(5204, '2014.6.18太原系统赴云南旅游', 4, '', '', NULL, 1403142000, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 6月10日，森马太原区域代理商白洪景组织员工及二级代理商赴云南旅游。</DIV>\n<DIV>白洪景把这次旅游视为践行“小河有水大河满”共赢文化的实际行动。他表示，为二级客户全心全力服务，尽心尽责提升二级客户业绩，一直以来是太原加盟区域的工作重心。他说，通过组织类似活动，有利于让区域内的代理商团队更加团结，有利于大家统一思想，为区域未来发展打好基础。</DIV>\n<DIV>“魅力森马，畅游云南”，在旅游中，森马太原加盟区域的二级代理商和员工们，不仅放松了心情，而且增强了彼此间的感情。</DIV>\n<DIV align=right>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <B>王步霖</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461994055103.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461994055985.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461994055787.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201461994055242.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 851, '董事长办公室二', 1403142000, 1403142000, '森马', 0, 0),
