(5232, '2014.7.14森马福建区域组织召开代理商大会', 4, '', '', NULL, 1405315380, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 7月7日，森马福州代理商林旭组织福建区域各级代理商召开全区域代理商大会。</DIV>\n<DIV>森马事业部加盟销售系统总监鲁向阳在会上宣读了福建代理商变更的通知，并介绍了相关商务政策。作为森马福建区域最早的一级代理商，林旭与森马有着不解之缘；如今再次回到熟悉的热土，负责福州市场，他表示，这是一种缘分，也是公司的信任。林旭表示，面对日益严峻的市场形势，要重振旗鼓，再次出发，彼此信任，相互支持，自己一定要发挥龙头表率作用，用实际行动带着大家共同发展。</DIV>\n<DIV>据了解，福州区域计划在三季度启动拓展开店的计划，在福州主商圈、主路段开设1200平方米新形象大店，在重点地级市——泉州开设400平方米标准店铺；另在南平、福州外围等地，也均有新店开设规划。</DIV>\n<DIV>与会人员除现有二级代理商外，还包括一些意向客户，他们十分认同福建加盟区域在发展战略、终端运作、渠道建设等方面的新规划，希望加入森马大家庭，共赢发展。</DIV>\n<DIV>福州团队区域运营总负责人李莉娟介绍了新的工作流程和下半年终端激励方案，分享了团队管理经验，并就大家所关心的去库存及人员管理问题提出了具体而详细的建议。</DIV>\n<P><B>林建霞</B></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20147193230247.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20147193230680.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center>&nbsp;</P>', 345, '董事长办公室二', 1405315380, 1405315380, '森马', 0, 0),
(5233, '2014.7.11森马通辽和平路店盛大开业', 4, '', '', NULL, 1405316940, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 6月29日，森马通辽市和平路新形象店盛大开业。</DIV>\n<DIV>该店位于通辽市核心商圈，营业面积近350平方米，在店面形象、货品品类以及陈列推广等方面都让人眼前一亮，成为当地标杆型店铺。</DIV>\n<DIV>森马通辽代理商表示，新形象让通辽森马焕然一新，让他更有信心继续保持森马品牌在当地的领先势头。</DIV>\n<DIV>开业当天，消费者摩肩接踵，销售业绩十分喜人。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV align=right><B>沈伟</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496985.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496961.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496763.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496275.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014719349610.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496904.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496244.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496480.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147193496181.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 581, '董事长办公室二', 1405316940, 1405316940, '森马', 0, 0),
(5234, '2014.7.14森马包头二街店开业', 4, '', '', NULL, 1405392300, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 7月5日，采用第10代新形象的森马包头昆区步行街二店隆重开业。</DIV>\n<DIV>该店营业面积达1200平方米，采用了森马第10代店铺形象、道具。该店开业，巩固了森马品牌在包头市场“四店一柜”的渠道格局，使森马品牌进一步牢牢占据当地休闲服市场领袖地位，品牌影响力持续提升。</DIV>\n<DIV>该店是包头代理商响应公司号召开设的第4家大店。代理商表示，开好大店是深挖市场、做大市场份额的重要举措，接下来，要想方设法，把大店经营管理抓上去。</DIV>\n<DIV>开业当天，新店铺吸引了众多消费者，进店率和销售业绩都明显提升。周边地区二级代理商也纷纷到该店观摩学习，他们表示，新形象提升了自己开大店和进一步发展的信心。</DIV>\n<DIV>&nbsp;</DIV>\n<DIV align=right><B>王步霖</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458342.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458212.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458182.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458537.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458314.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458771.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458112.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201471510458235.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 622, '董事长办公室二', 1405392300, 1405392300, '森马', 0, 0),
