(5238, '2014.7.17森马湖南区域品介会', 4, '', '', NULL, 1405576140, 1420041600, 0, '<DIV>本网讯 &nbsp;签约空白市场20个，意向店铺面积达4000平方米……这是7月5日森马湖南区域品牌推介会所取得的成果。</DIV>\n<DIV>在这次由森马加盟销售系统中大区组织的品牌推介会上，森马加盟销售系统总监鲁向阳及中大区团队就森马品牌发展、公司转型战略、未来前景规划、业务运营管理及招商加盟等内容，同与会客户代表进行了坦诚的沟通交流。</DIV>\n<DIV>50多位来自湖南空白市场的意向客户和发展意愿强烈的现有森马湖南区域各级代理商参加了会议。会议次日，签约客户还出席了湖南株洲金冠新形象店开业典礼，饶有兴趣地了解森马品牌终端运营情况。</DIV>\n<DIV>森马加盟销售系统负责人表示，这是该系统组织召开的首次区域品牌推介会，收效超过预期，为森马品牌今后在湖南区域的扩张发展打下了很好基础。</DIV>\n<DIV>&nbsp;</DIV>\n<P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<B>&nbsp;</B><B>张晓强</B></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014717134953574.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014717134953555.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014717134953357.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014717134953769.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014717134953602.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center>&nbsp;</P>', 377, '董事长办公室二', 1405576140, 1405576140, '森马', 0, 0),
(5239, '2014.7.17森马云南区优秀店长训练营第一期开营', 4, '', '', NULL, 1405582620, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 近日，由森马加盟销售系统组织的云南区域优秀店长训练营在昆明举办。</DIV>\n<DIV>在为期3天半的培训中，森马零售支持部张玮炜向学员们讲授了店长高效的一天、零售业绩的分析与改善、道具与模特、品类推广案例等课程。参加此次培训的学员十分投入，直至深夜，仍利用微信等交流当天所学功课。学员们表示，3天半时间虽然短暂，但收获了知识和友谊，在训练营中所学到的技能一定会在今后店铺工作中派上大用场。</DIV>\n<DIV align=right>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<A name=_GoBack></A><B>彭灿</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752689.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752671.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752472.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752716.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20147171537550.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752221.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752517.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752696.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752230.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014717153752224.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>