(5256, '关于重点店铺14Q3形象考核照片上传的通知', 19, '', '', NULL, 1407396480, 1420041600, 0, '<FONT size=2>各位代理商： </FONT>\n<DIV></DIV><FONT size=2>大家好！ </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 关于14Q3重点店铺的形象考核已经开始，请达标并有征订陈列品的店铺对14Q3 </FONT><FONT size=2>店铺形象表现情况，按照月份主推排序依次进行拍照上传。 </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>形象考核主题：Soft touch&nbsp; 新触感 </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>考核内容： 1、7月主推法兰绒衬衫橱窗表现、形象区表现、边场/中场表现. 上传截止时间：8月31日。 </FONT>\n<DIV>&nbsp;</DIV>\n<P><FONT size=2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;2 、8月主推卫衣橱窗表现、形象区表现、边场/中场表现. 上传截止时间：9月30日。 </FONT></P>\n<DIV><FONT size=2></FONT>&nbsp;</DIV><FONT size=2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3、9月主推轻薄羽绒橱窗表现、形象区表现、边场/中场表现. 上传截止时间：10月15日。 </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>请各代理商注意3批形象的上传截止时间依次上传。 </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>上传地址：</FONT><A href="http://pic4.semir.com/"><FONT size=2>http://pic4.semir.com/</FONT></A><FONT size=2> </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>上传文件夹：店铺名称—14Q3陈列考核。 </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>照片上传格式：jpg/jpeg格式。 </FONT>\n<DIV>&nbsp;</DIV><FONT size=2>最终结果将参照《2014年Q3季形象支持及考核管理办法》执行。 </FONT>\n<DIV>&nbsp;</DIV>\n<P align=right><FONT size=2>零售支持部 陈列科&nbsp;&nbsp;&nbsp; 2014年8月7日</FONT></P>', 1348, '零售支持部-陈列科', 1407396480, 1407396780, '森马', 0, 0),
