(5261, '14年秋季学前活动方案', 8, '', '', NULL, 1408006140, 1420041600, 0, '<P align=center><IMG border=0 src="/Uploads/UploadFile/201481964958996.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201481964959540.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201481964959341.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201481964959641.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201481964959474.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20148196495912.jpg"></P>\n<P align=center>&nbsp;</P>', 759, '零售支持部——促销推', 1408006140, 1408006140, '森马', 0, 0),
(5262, '加盟系统优秀店长训练营---河北省第一期', 26, '', '', '/Uploads/20141107/545c3bef807ca.jpg', 1408067580, 1420041600, 0, '<div>\r\n	本网讯 4月22日，由森马加盟销售系统组织的优秀店长训练营在石家庄开营。</div>\r\n<div>\r\n	在开营前一晚，培训小组以竞选班长、学习委员以及分组等形式，有效营造出团结、紧张、严肃、活泼<a name="_GoBack"></a>的学习气氛，为培训工作做了铺垫。本次培训的所有课程均由终端经验丰富的资深人士开发，与森马品牌契合度较高、落地性强，易于操作。培训过程中，讲师注重参训学员的学习效果，采取了讲、练、考相结合的方式，收效显著。</div>\r\n<div>\r\n	参加培训的学员表示，通过为期3天的培训，对店铺管理工作有了更明确的目标。<b style="mso-bidi-font-weight: normal;"><span style="font-family: 宋体; font-size: 12pt; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;">叶小丰</span></b></div>\r\n<div align="center">\r\n	<b style="mso-bidi-font-weight: normal;"><span style="font-family: 宋体; font-size: 12pt; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;"><img border="0" src="/Uploads/UploadFile/201481595344550.jpg" /></span></b></div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n<div align="center">\r\n	<b style="mso-bidi-font-weight: normal;"><span style="font-family: 宋体; font-size: 12pt; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;"><img border="0" src="/Uploads/UploadFile/201481595344532.jpg" /></span></b></div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n', 191, '零售督导科', 1408067580, 1415330804, '森马', 0, 0),
(5263, '加盟系统优秀店长训练营---江苏省第一期', 26, '', '', NULL, 1408068180, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 5月12日，由森马加盟销售系统组织的江苏区优秀店长训练营第一期在上海园区开营。</DIV>\n<DIV>在3天的学习中，学员们积极参与，还通过“江苏一班”的微信群分享学习心得。每门课程结束后，组织者都会及时跟进，与学员沟通作业完成情况，检验学员的学习效果。</DIV>\n<DIV>学员们普遍对此次集训营活动，表示了满意，大家觉得通过集训，不仅对店铺日常的工作有了更明确的管理目标，而且对卖场的陈列有了更加清晰的思路。</DIV>\n<DIV align=right><B>王文亮</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328943.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328868.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328614.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328970.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328295.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328136.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328320.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510328499.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 219, '零售督导科', 1408068180, 1408068180, '森马', 0, 0),
(5264, '加盟系统优秀店长训练营---四川省第一期', 26, '', '', NULL, 1408068480, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 5月29日，由森马加盟销售系统组织的西南区优秀店长训练营第一期在成都圆满结束。</DIV>\n<DIV>本次培训以小组计分的形式展开，通过店长们组内协作<A name=_GoBack>和</A>组外竞争的方式，营造了团结、积极、紧张的学习氛围。培训的内容由浅入深，逐步推进，利用课后作业、随堂考试等形式，帮助店长们深入掌握了店铺运营标准和相关店长工作的方式方法，受到了参训者们的一致好评。</DIV>\n<DIV>培训期间，学员们还通过“四川一班”的微信群，及时分享了学习心得。这种现代沟通形式克服了以往区域培训的“只能撒网，难管收获”的弊端，拉近了大家的距离。</DIV>\n<DIV><B>敬晶晶</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510674.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20148151024799.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20148151024545.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014815102500.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20148151024677.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20148151024518.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 218, '零售督导科', 1408068480, 1408068480, '森马', 0, 0),
(5265, '加盟系统优秀店长训练营---云南省第一期', 26, '', '', NULL, 1408069080, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 近日，由森马加盟销售系统组织的云南区域优秀店长训练营在昆明举办。</DIV>\n<DIV>在为期3天半的培训中，森马零售支持部的王嘉熠、张玮炜、黄军向学员们讲授了店长高效的一天、零售业绩的分析与改善、道具与模特、品类推广案例等课程。参加此次培训的学员十分投入，直至深夜，仍利用微信等交流当天所学功课。学员们表示，3天半时间虽然短暂，但收获了知识和友谊，在训练营中所学到的技能一定会在今后店铺工作中派上大用场。</DIV>\n<DIV align=right><B>彭灿</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182197.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182627.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182429.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182785.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182674.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182514.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182810.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182989.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182747.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182741.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182520.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182791.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182362.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510182805.jpg"></DIV>\n<DIV align=center>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 262, '零售督导科', 1408069080, 1408069080, '森马', 0, 0),
(5266, '加盟系统优秀店长训练营---浙江省第一期', 26, '', '', NULL, 1408069380, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 5月4日，由森马加盟销售系统组织的东一区优秀店长训练营第一期在上海园区开营。</DIV>\n<DIV>培训课程由终端经验丰富的资深人士开发，与森马品牌形象契合度高，落地性强，易于操作。培训以分组的形式展开，通过事先组织竞选班长、学习委员等活动，有效营造出了团结、紧张、严肃、活泼的学习气氛。每门课程结束后，组织者会及时跟进检验学员的学习效果。培训期间，学员们还通过“浙江一班”微信群，及时分享学习心得，沟通作业完成情况。</DIV>\n<DIV>学员们纷纷表示，期待第二期的举行，希望能学到更多成长的知识。</DIV>\n<DIV align=right><B>王娟</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014815102338396.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014815102338322.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014815102338179.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014815102338535.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/2014815102338424.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201481510233818.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 443, '零售督导科', 1408069380, 1408069380, '森马', 0, 0),
