(5278, '2014.8.26森马昆明小西门大观店以崭新形象亮相', 4, '', '', NULL, 1409103540, 1420041600, 0, '<DIV>本网讯&nbsp; 8月24日，森马品牌云南市场首家十代新形象店——昆明小西门大观店盛大开业。</DIV>\n<DIV>该店位于昆明市核心商圈，营业面积达700多平方米。森马事业部加盟销售系统总监鲁向阳在开业典礼上表示，大观旗舰店的开业，标志着森马品牌将在当地市场进一步发力，为广大消费者带来更好的消费体验。他相信，该店会为森马品牌在云南市场的发展树立良好榜样。</DIV>\n<DIV>在开业典礼上，还举行了时尚走秀，展示了森马品牌卫衣、棒球服、法兰绒衬衫、GSON系列等今秋新产品，吸引了众多消费者。</DIV>\n<DIV>森马云南市场各级代理商参加了开业庆典，他们对新形象赞不绝口。</DIV>\n<DIV align=right><B>彭灿</B></DIV>\n<DIV align=right><B></B>&nbsp;</DIV>\n<DIV align=center><B><IMG border=0 src="/Uploads/UploadFile/201482793918865.jpg"></B></DIV>\n<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B><IMG border=0 src="/Uploads/UploadFile/2014827939490.jpg"></B></DIV>\n<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B><IMG border=0 src="/Uploads/UploadFile/201482793918536.jpg"></B></DIV>\n<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B><IMG border=0 src="/Uploads/UploadFile/201482793918892.jpg"></B></DIV>\n<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B><IMG border=0 src="/Uploads/UploadFile/201482793918893.jpg"></B></DIV>\n<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B><IMG border=0 src="/Uploads/UploadFile/2014827939433.jpg"></B></DIV>\n<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B><IMG border=0 src="/Uploads/UploadFile/201482793918973.jpg"></B></DIV>\n<DIV align=center><B></B>&nbsp;</DIV>\n<DIV align=center><B><A name=_GoBack></A></B>&nbsp;</DIV>', 509, '董事长办公室二', 1409103540, 1409103540, '森马', 0, 0),
