(5286, '广西代理商组织首期员工素质拓展训练营', 4, '', '', NULL, 1409621040, 1420041600, 0, '<DIV>本网讯 &nbsp;&nbsp;近日，广西代理商<A name=OLE_LINK2></A><A name=OLE_LINK1>刘仲铨</A>在广西桂林组织开展首期员工素质拓展训练营。</DIV>\n<DIV>刘仲铨是与公司合作多年的代理商，代理了森马和巴拉巴拉两大品牌，终端员工近1000名。拓展训练营以“拥青春·正能量”为主题，旨在传递正能量、树立正确价值观，共分4场培训。</DIV>\n<DIV>参加拓展训练营的员工纷纷表示，这次拓展训练虽然时间短暂，但令人难忘，受益非浅，从中感受到了集体的温暖和团结的力量。 </DIV>\n<DIV align=right>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <B>余科</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20149292415924.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20149292415286.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20149292415931.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20149292415555.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20149292415388.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/20149292415172.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 352, '董事长办公室二', 1409621040, 1409621040, '森马', 0, 0),
(5287, '森马合肥五河店新装亮相', 4, '', '', NULL, 1409649900, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 8月8日，森马合肥五河万福商业广场旗舰店隆重开业。由“男神来袭”森马品牌形象代言人李敏镐、金秀贤广告宣传画构成的店铺外立面，端庄大气，格外引人注目，吸引了大量消费者。</DIV>\n<DIV>该店上下两层，格局划分明晰，采用最新的店铺形象和道具，从最初的设计到内部场区的划分、陈列布置，都严格按照公司标准执行，力求打造当地标杆店铺。</DIV>\n<DIV>森马合肥系统代理商专门前往该店参观学习，了解新的陈列方法，探讨县级店铺的形象打造与营销思路，代理商们纷纷表示，该店称得上全系统形象、配置最新的县级店铺，势必为合肥区域森马品牌的形象提升起到很好的示范作用。</DIV>\n<P><B>林少杰</B></P>\n<P><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149217255831.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149217256374.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149217256344.jpg"></P>\n<P align=center><STRONG></STRONG>&nbsp;</P>\n<P align=center>&nbsp;</P>', 681, '董事长办公室二', 1409649900, 1409649900, '森马', 0, 0),
(5288, '14Q3轻薄羽绒陈列方案', 18, '', '', NULL, 1409708820, 1420041600, 0, '<P align=center><IMG border=0 src="/Uploads/UploadFile/2014939474140.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742908.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742710.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742953.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742786.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742683.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742923.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742202.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742184.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149394742178.jpg"></P>\n<P align=center>&nbsp;</P>\n<P align=center>&nbsp;</P>', 1025, '陈列部', 1409708820, 1409708820, '森马', 0, 0),
