(5290, '森马江苏区域推出精英店长成长计划', 4, '', '', NULL, 1409733600, 1420041600, 0, '<DIV align=left>本网讯&nbsp; 为提升终端店铺店长的综合实力，促进零售业绩的提升，前不久，森马江苏区域推出精英店长成长计划。</DIV>\n<DIV align=left>该计划从今年3月份开始实施，历时一年时间。计划实施以来，取得了良好效果，让越来越多的店长激发出更大的工作热情，店铺形象、陈列，终端活动等多方面能力也有了明显提升，进而使整个区域的销售业绩同比提升了35%，创历史新高（其中，24家精英店铺零售提升60%，特别是兴化和通州的新形象店零售同比分别提升了152%和288%）。</DIV>\n<P align=left><B>李羚玉</B></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201493164017637.jpg"></P>', 589, '董事长办公室二', 1409733600, 1409733600, '森马', 0, 0),
(5291, '狭路相逢勇者胜PK赛第一期——东一区第二周总结', 23, '', '', NULL, 1409805420, 1420041600, 0, '<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412703.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412685.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014951054166.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412674.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/2014951054177.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412403.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/20149510541183.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412822.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412412.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412406.jpg"></P>\n<P align=center><IMG border=0 src="/Uploads/UploadFile/201495105412917.jpg"></P>', 537, '零售支持部--促销推', 1409805420, 1409885640, '森马', 0, 0),
(5292, '森马合肥代理商组织先进员工赴京旅游', 4, '', '', NULL, 1410324540, 1420041600, 0, '<DIV>本网讯&nbsp;&nbsp; 8月18日，森马合肥代理商组织区域内2013年度先进员工赴北京开展为期5天的文化体验之旅。</DIV>\n<DIV>在北京期间，先进员工先后游览了天安门、故宫、天坛、长城等景点，品尝了北京特色美食，在国家奥林匹克公园观看了表演，到798艺术区欣赏了艺术创意建筑。</DIV>\n<DIV>森马合肥代理商表示，组织先进员工外出旅游，在合肥区域已经制度化。此举，一来是对先进员工辛勤付出的回报，二来也可借此加强员工之间的沟通交流，增强团队凝聚力。</DIV>\n<DIV align=right><B>王雪伟</B></DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201491012542266.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201491012542979.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201491012542444.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201491012542800.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201491012542577.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201491012542417.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center><IMG border=0 src="/Uploads/UploadFile/201491012542825.jpg"></DIV>\n<DIV align=center><STRONG></STRONG>&nbsp;</DIV>\n<DIV align=center>&nbsp;</DIV>', 365, '董事长办公室二', 1410324540, 1410324540, '森马', 0, 0),
(5293, '森马锡林浩特维多利步行街新形象店开业', 4, '', '', '', 1410340080, 1420041600, 0, '<div>\r\n	本网讯&nbsp; 8月23日，森马内蒙古锡林浩特维多利步行街店以森马最新形象展现在消费者面前。</div>\r\n<div>\r\n	该店位于维多利步行街的最佳位置，为独栋建筑，上下两层，营业面积近550平方米。该店以森马最新形象装饰一新，吸引了大量消费者，销售势头火爆。</div>\r\n<p>\r\n	<b>沈伟</b></p>\r\n<p align="center">\r\n	<img border="0" src="/Uploads/UploadFile/201491017842657.jpg" /></p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n<p align="center">\r\n	<img border="0" src="/Uploads/UploadFile/201491017842190.jpg" /></p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n<p align="center">\r\n	<img border="0" src="/Uploads/UploadFile/201491017842892.jpg" /></p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n<p align="center">\r\n	<img border="0" src="/Uploads/UploadFile/201491017842403.jpg" /></p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n<p align="center">\r\n	<img border="0" src="/Uploads/UploadFile/201491017842236.jpg" /></p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n<p align="center">\r\n	<img border="0" src="/Uploads/UploadFile/201491017842133.jpg" /></p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n<p align="center">\r\n	<img border="0" src="/Uploads/UploadFile/201491017842373.jpg" /></p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n<p align="center">\r\n	&nbsp;</p>\r\n', 618, '董事长办公室二', 1410340080, 1415076745, '森马', 1, 1),
