(5321, '森马大同华严街新形象店开业', 4, '', '该店为公司多品牌集成店，面积约1100平方米，采用全新的森马十代店铺形象，和该街仿古的造型风格相得益彰，成为了商业街的标志性店铺。店铺内部还增设了游戏区和休闲饮品等功能区，为消费者提供了更加丰富的服务体验。', '/Uploads/20141104/545880fbade36.jpg', 1412927880, 1420041600, 0, '<div>\r\n	本网讯&nbsp;&nbsp; 9月28日，森马山西大同华严街新形象店开业。</div>\r\n<div>\r\n	该店为公司多品牌集成店，面积约1100平方米，采用全新的森马十代店铺形象，和该街仿古的造型风格相得益彰，成为了商业街的标志性店铺。店铺内部还增设了游戏区和休闲饮品等功能区，为消费者提供了更加丰富的服务体验。</div>\r\n<div>\r\n	金秋时节，森马大同代理商在公司新店政策的推动下，积极拓展市场，已开出了3店1柜，营业面积增加了近1500平方米，有力推动了品牌在大同市场的进一步发展。</div>\r\n<div>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>&nbsp;</b><b>王步霖</b></div>\r\n<div align="center">\r\n	<img border="0" src="/Uploads/UploadFile/20141010155823814.jpg" /></div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n<div align="center">\r\n	<img border="0" src="/Uploads/UploadFile/20141010155823176.jpg" /></div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n<div align="center">\r\n	<img border="0" src="/Uploads/UploadFile/20141010155823936.jpg" /></div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n<div align="center">\r\n	<img border="0" src="/Uploads/UploadFile/20141010155823392.jpg" /></div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n<div align="center">\r\n	<img border="0" src="/Uploads/UploadFile/20141010155823281.jpg" /></div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n<div align="center">\r\n	&nbsp;</div>\r\n', 681, '董事长办公室二', 1412927880, 1415086334, '森马', 1, 1),
(5322, '关于重点店铺14Q4形象考核照片上传的通知', 19, '', '', NULL, 1413355200, 1420041600, 0, '<DIV>各位代理商：</DIV>\n<DIV>大家好！</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 关于14Q4重点店铺的形象考核已经开始，请所有参于14年冬季陈列品赠送并有征订陈列品的店铺对14Q4店铺形象表现情况，按照月份主推排序依次进行拍照上传。</DIV>\n<DIV>形象考核主题：&nbsp; 心温暖 </DIV>\n<DIV>考核内容： 1、 10月主推多彩羽绒橱窗表现、形象区表现、边场/中场表现。上传截止时间：10月31日。</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2、 11月主推拼接羽绒橱窗表现、形象区表现、边场/中场表现。&nbsp;上传截止时间：11月15日。</DIV>\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3、&nbsp;12月主推棉质羽绒橱窗表现、形象区表现、边场/中场表现。 上传截止时间：12月15日。</DIV>请各代理商注意3批形象的上传截止时间依次上传。 \n<DIV>&nbsp;</DIV>&nbsp;上传地址：http://pic4.semir.com/ \n<DIV>&nbsp;</DIV>&nbsp;上传文件夹：店铺名称—14Q4陈列考核。 \n<DIV>&nbsp;</DIV>照片上传格式：jpg/jpeg格式。 \n<DIV>&nbsp;</DIV>最终结果将参照《2014年Q4季形象支持及考核管理办法》执行。 \n<DIV>&nbsp;</DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 零售支持部 陈列科', 735, '零售支持部-陈列科', 1413355200, 1413355320, '森马', 0, 0),
